The Rock Band 2 soundtrack will feature over 100 songs with over 80 songs on disc plus an additional 20 bonus tracks which will be made available for free download this fall. This builds upon the unparalleled depth and diversity of Rock Band%u2019s original set list and its ever-expanding library of downloadable tracks. Comprised entirely of master recordings from some of rock%u2019s most prolific and untouchable artists, including AC/DC, Guns N%u2019 Roses, Bob Dylan, Metallica, Pearl Jam and more, Rock Band 2 will deliver the most impressive and largest music catalogue of any music-based videogame ever. * After 14 years since Guns N%u2019 Roses last official music release, Axl Rose selects Rock Band 2 to debut official new track %u201CShackler-s Revenge%u201D from the highly-anticipated album Chinese Democracy. * Rock Band 2 is the first and only video game to feature the music of AC/DC.



It includes their epic rock anthem,


